import { Fragment, useState } from "react";
import { BottomNavigation, Divider } from "@mui/material";
import myLinks from "../myLinks";
import NavLinkComponent from "../header/NavLinkComponent"; // Make sure you've imported this correctly
import nextKey from "generate-my-key"; // Ensure that this key generation utility is imported and works as expected


const FooterComponent = () => {
  const [value, setValue] = useState(0);

  return (
    <Fragment>
      <Divider />
      <BottomNavigation
        showLabels
        value={value}
        onChange={(event, newValue) => {
          setValue(newValue);
        }}
      >
        {myLinks.map((mylink) => (
          <NavLinkComponent to={mylink.to} key={mylink.key || nextKey()}>
            {mylink.children}
          </NavLinkComponent>
        ))}
      </BottomNavigation>
    </Fragment>
  );
};

export default FooterComponent;
